export default function Lista(props){
    return(<div id="listaHerramientas">
        {props.productos.map((item) => {
            return(
                <div class="tarjeta" onClick={()=>console.log(item.id)}>
                    <div class="imagenHerramienta"></div>
                    <div class="tituloHerramienta"></div>

                </div>
            )
        })}
    </div>
    )
}
